// @ts-ignore
import React, {useState} from "react";

function TransactionApp(){
    const [transactions, setTransactions] = useState([]);

    const handlerBuyClick = () => {
        setTransactions([...transactions, Math.random()]);
    };

    const handlerSellClick = () => {
        setTransactions([...transactions, -1 * Math.random()]);
    };

    return (
        <div className="grid-container">
            <h1>Transaction Page</h1>
            <button onClick={handlerBuyClick}>Buy</button>
            <button onClick={handlerSellClick}>Sell</button>
            <div>
                <h2>Transaction Chain</h2>
                <ul>
                    {transactions.map((transaction, index)=> (
                        <li key={index}>{transaction.toFixed(2)}</li>
                    ))}
                </ul>
            </div>
        </div>
    );

}

export default TransactionApp;
